INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 127702, 2002, "2023/09/15 15:00:00", -470.0, 0.0, "2023/12/22 14:59:59", 2, 10006, 2, "リンド", 2, "ショップの掃除は完璧です\n姫さま直営のお店として\n当然のことですから", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 127802, 2002, "2023/09/15 15:00:00", -470.0, 0.0, "2023/12/22 14:59:59", 1, 10007, 2, "ヴルム", 1, "ショップへようこそ\nキャラバンコインと品物を\n交換できるんで、よければ", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 127802, 2002, "2023/09/15 15:00:00", -470.0, 6.5, "2023/12/22 14:59:59", 2, 10008, 2, "ヴルム", 1, "なんで店番なんか…\nま、やりますけど\n好きな品物をどうぞ", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 129602, 2002, "2023/12/15 15:00:00", -470.0, 0.0, "2024/03/22 14:59:59", 1, 10009, 3, "アネモネ", 1, "──いらっしゃいませ\n買い物しても、いいですよ\nキャラバンコインがあれば", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 129602, 2002, "2023/12/15 15:00:00", -470.0, 0.0, "2024/03/22 14:59:59", 2, 10010, 3, "アネモネ", 1, "──もっと笑顔がほしい？\nいくらコインを積まれても\n売れない物はありますから", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 129701, 2002, "2023/12/15 15:00:00", -470.0, 0.0, "2024/03/22 14:59:59", 1, 10011, 3, "ネフィ=ネラ", 1, "ようこそおいでなんし\nキャラバンコインをこちら\nで交換して進ぜんしょう", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 129701, 2002, "2023/12/15 15:00:00", -470.0, 6.2, "2024/03/22 14:59:59", 2, 10012, 3, "ネフィ=ネラ", 1, "ところで、お前さまは\nいくらで贖えるのか喃？\n──フフ、冗談でありんす", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 130301, 2002, "2024/03/15 15:00:00", -470.0, 3.1, "2024/06/22 14:59:59", 1, 10013, 4, "カノン", 5, "い、いらっしゃいませっ！\n…くっ…このあたくし様が\n店番なんて…屈辱ですわっ", 3);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 130301, 2002, "2024/03/15 15:00:00", -470.0, 6.15, "2024/06/22 14:59:59", 2, 10014, 4, "カノン", 2, "あら、あたくしをご所望？\nお生憎様、そんな小銭では\n…買えちゃうんですの！？", 3);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 130401, 2002, "2024/03/15 15:00:00", -470.0, 0.0, "2024/06/22 14:59:59", 1, 10015, 4, "ナーナ", 2, "いらっしゃいませ～♪\nきゃらばんこいん？を\n交換できるんだってー", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 130401, 2002, "2024/03/15 15:00:00", -470.0, 3.35, "2024/06/22 14:59:59", 2, 10016, 4, "ナーナ", 1, "甘いのくれたら、\nお礼にナーナの拾った\n松ぼっくりあげちゃうよ！", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 130502, 2002, "2024/06/15 15:00:00", -470.0, 0.0, "2024/09/22 14:59:59", 1, 10017, 5, "ホウオウ", 1, "ショップへようこそ\nこの鳳凰が、皆さんに\n祝福を差し上げましょう", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 130502, 2002, "2024/06/15 15:00:00", -470.0, 3.18, "2024/09/22 14:59:59", 2, 10018, 5, "ホウオウ", 1, "ほーちゃんと呼ぶ権利は\n売っていませんよ？\n騎士さんへの、特別です！", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 130503, 2002, "2024/06/15 15:00:00", -470.0, 0.0, "2024/09/22 14:59:59", 3, 10019, 5, "ホウオウ", 4, "うﾞぇぇえんっ！まﾞだごの\n格好になっぢゃいまじだ！\n寄付をお願いじまず～っ！", 4);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 123301, 2002, "2024/06/15 15:00:00", -470.0, 4.9, "2024/09/22 14:59:59", 1, 10020, 5, "ネア", 2, "おっすー♪\nなんでも交換してけー\nカリザきゅん以外で", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 123301, 2002, "2024/06/15 15:00:00", -470.0, 4.8, "2024/09/22 14:59:59", 2, 10021, 5, "ネア", 2, "ところで、騎士きゅんは\nおいくら万ルピ？\nジョーダンぬ・き・で♡", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133301, 2002, "2024/09/15 15:00:00", -470.0, 4.922, "2024/12/22 14:59:59", 1, 10022, 6, "カリザ", 1, "ケッ、なんでオレ様が店番\nなんざ…って来んなキイロ\nオレは売りモンじゃねー！", 3);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133301, 2002, "2024/09/15 15:00:00", -470.0, 9.638, "2024/12/22 14:59:59", 2, 10023, 6, "カリザ", 5, "い、言わなきゃダメか？\n「…いらっしゃいませ…」\nクソッ、笑うんじゃねー！", 3);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133401, 2002, "2024/09/15 15:00:00", -470.0, 2.88, "2024/12/22 14:59:59", 1, 10024, 6, "ミーア", 2, "ショップへようこそ～\nネラさまの腹心…的な私が\n店番させていただきま～す", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133401, 2002, "2024/09/15 15:00:00", -470.0, 4.818, "2024/12/22 14:59:59", 2, 10025, 6, "ミーア", 1, "私の抜け殻とか、\n需要ありますかね～…\nって冗談ですよ、冗談！", 5);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133002, 2002, "2024/12/15 15:00:00", -470.0, 1.78, "2025/03/22 14:59:59", 1, 10026, 7, "グレイス", 1, "へい、らっしゃい\nさ、騎士氏。冥土の土産は\nなにがいいですか？", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133002, 2002, "2024/12/15 15:00:00", -470.0, 6.15, "2025/03/22 14:59:59", 2, 10027, 7, "グレイス", 7, "商品をお買い上げ毎に\nグレイスちゃんポイントを\n差し上げます。嘘ですが", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133102, 2002, "2024/12/15 15:00:00", -470.0, 4.28, "2025/03/22 14:59:59", 1, 10028, 7, "ヴァイオレット", 2, "ようこそいらっしゃいませ\n…接客とは、このような\n振舞で宜しいでしょうか？", 6);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 133102, 2002, "2024/12/15 15:00:00", -470.0, 0.0, "2025/03/22 14:59:59", 2, 10029, 7, "ヴァイオレット", 1, "じめじめした商品は\nございませんので\n安心してお買い求め下さい", 1);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 136902, 2002, "2025/03/15 15:00:00", -470.0, 5.53, "2025/06/23 14:59:59", 1, 10030, 8, "ルルィ", 1, "いらっしゃいましぇでしゅ\n何をお求めでしゅか？\nたこ焼きもありましゅよ！", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 136902, 2002, "2025/03/15 15:00:00", -470.0, 6.05, "2025/06/23 14:59:59", 2, 10031, 8, "ルルィ", 7, "そのコイン…ピカピカで、\n集めたくなっちゃいましゅ\nタコ釣られされちゃう～…", 9);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 137001, 2002, "2025/03/15 15:00:00", -470.0, 0.0, "2025/06/23 14:59:59", 1, 10032, 8, "デュラン", 1, "姫のご友人ならば\n礼儀を尽くすのが爺の務め\nさ、望みの物を言いたまえ", 2);
INSERT INTO `v1_5024d4057bf7c26e14b2b8b26920ae7a9152f7e4ed417d88a13a5b51ec52798c` VALUES (0.0, 137001, 2002, "2025/03/15 15:00:00", -470.0, 0.0, "2025/06/23 14:59:59", 2, 10033, 8, "デュラン", 1, "キャラバンコインではなく\n首で支払って貰えんかのぅ\n…冗談であるぞ？", 2);
